      "serviceProviderPhone": booking.ServiceProviderPhone,
      "serviceStartTime": booking.ServiceStartTime,
      "serviceProviderLocation": booking.ServiceProviderLocation,
      "bookingStatus": booking.BookingStatus,
      "queueNumber": str
    };
    const myJSON = encodeURI(JSON.stringify(queueObject));
    const xhr = new XMLHttpRequest(),
          method = "GET",
          url = "https://hyxfimzf9g.execute-api.us-east-1.amazonaws.com/default/sender?bookingID=" + bookingId + "&exchangeID=master&bindingKey=sgh.doctor&bookingDetails=" + myJSON; // initialize a new GET request

